import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Carrusel from './componentes/Carrusel.jsx';
import Navbar from './componentes/navbar.jsx';
import ScreemDinamic from './componentes/screem.js';
import Footer from './componentes/footer.js';
im

function App() {

  return (
    <Router>
      <div className="App">
        <Navbar />
        <Switch>
          <Route path="/" exact >
          <ScreemDinamic />
          <Carrusel />
          <br></br><br></br><br></br>
          <Carrusel />
          <br></br><br></br><br></br>
          <Carrusel />
          <br></br><br></br><br></br>
          <Carrusel />
          <br></br><br></br><br></br>
          <br></br><br></br><br></br>
          </Route>
          <Route path="/videojuego" Component={Videojuego}/>
          </Switch>
          <Footer />
      </div>
    </Router>
  );
}

export default App;
